        starTween.to(star, {
            y: 80 * scX,
            x: this.scene.width + 200 * scX,
            rotation: 600
        }, 1000, Laya.Ease.linearInOut, 0);
        starTween.to(star, {}, 3000, Laya.Ease.linearInOut, 0);
        starTween.to(star, {
            y: this.scene.height / 1.4,
            x: -49 * scX,
            rotation: 0
        }, 0, Laya.Ease.linearInOut, 0);
