        if (this.useBS) { //使用笔刷
            this.userHammer(events.index);
            this.gameEnd = false;
            return;
        }
        else if (this.useCZ) {
            this.usePercussion(events.index, e);
            this.useCZOk = false;
            this.gameEnd = false;
            return;
        }
        else if (this.useStar) {
            this.gameEnd = false;
            return;
        }
        if (this.playFlag) {
            this.clearAnimation(this.commStar);
            this.playFlag = false;
        }
        this.commStar = [];
        this.getCommStar(events.index);
        //下一步消除元素
        this.clearStar(this.commStar, events.index, false, false, { x: e.stageX, y: e.stageY });
