    //二维数组随机排序
    GameCode.prototype.sortDoubleArr = function (arr) {
        var starArrOne = this.flatten(arr); //将数组转为一维数组
        starArrOne.sort(function () { return 0.5 - Math.random(); }); //随机排序
        //循环二维数组,替换数组
        var m = 0;
        for (var i = 0; i < this.row; ++i) {
            for (var j = 0; j < this.clos; ++j) {
                if (arr[i][j] != 0) {
                    arr[i][j] = starArrOne[m];
                    m++;
                } //替换
            }
        }
        return arr;
    };
    //洗牌操作
    GameCode.prototype.refresh = function () {
        var _this = this;
        //随机排列数组
        //先将数组转化为一维数组
        //由于消除后，为0了，那么不能包含0
        var m = 0;
        //根据元素位置去刷新
        var starArrIndex = []; //记录元素的位置
        for (var i = 0; i < this.roleBox._children.length; ++i) {
            starArrIndex.push(this.roleBox._children[i].index);
        }
        //排序
        starArrIndex.sort(function () { return 0.5 - Math.random(); }); //随机排序
        var nowStarArr = [];
        for (var i = 0; i < this.row; ++i) {
            nowStarArr[i] = [];
            for (var j = 0; j < this.clos; ++j) {
                nowStarArr[i][j] = this.starArr[i][j];
            }
        }
        var starArrOne = this.flatten(nowStarArr);
        //转为一维数组
        for (var i = 0; i < starArrOne.length; ++i) {
            if (starArrOne[i] != 0) {
                var t = starArrOne[i];
                starArrOne[i] = starArrOne[starArrIndex[m]];
                starArrOne[starArrIndex[m]] = t;
                m++;
            }
        }
        m = 0;
        //位置排序以后重新设置二维数组
        for (var i = 0; i < this.row; ++i) {
            for (var j = 0; j < this.clos; ++j) {
                this.starArr[i][j] = starArrOne[m];
                m++;
            }
        }
        //检查是否结束
        if (this.gameOver()) {
            this.refresh(); //重复
        }
        else {
            m = 0;
            this.te = 0;
            //更新元素位置,需要更新name，index，但是不能同步更新，那样会存在错误
            for (var i = 0; i < this.row; ++i) {
                for (var j = 0; j < this.clos; ++j) {
                    if (this.starArr[i][j] != 0) {
                        var child = this.roleBox.getChildByName("role" + starArrIndex[m]); //获取到元素
                        Laya.Tween.to(child, {
                            x: (this.rowWidth() - child.width) / 2 + i * this.rowWidth(),
                            y: (this.rowWidth() - child.height) / 2 + j * this.rowWidth(), update: Laya.Handler.create(this, function (e) {
                            })
                        }, 100, Laya.Ease.linearOut, Laya.Handler.create(this, function (e) {
                            _this.te++;
                        }), 0);
                        m++;
                    }
                }
            }
            m = 0;
            Laya.timer.loop(1, this, this.exchangeRoleBox);
        }
    };
