    //飞出道具去击打
    GameCode.prototype.flayProp = function (propName, role, lens, basics) {
        var _this = this;
        var w = 88;
        var h = 88;
        var scX = Laya.Browser.window.scX;
        var position = this.getPos(role.index);
        var sp = this.getImage("start1/fooda" + config_1.default.iconLevel + ".png", w * scX, h * scX, this.roleBox.x + role.x, this.roleBox.y + role.y - role.height / 2 + h * scX / 2);
        sp.pivot(sp.width / 2, sp.height / 2);
        sp.alpha = 0;
        var timeJd = new Laya.TimeLine();
        timeJd.to(sp, {
            y: sp.y - 20,
            alpha: 1
        }, 500, Laya.Ease.linearInOut, 0);
        var xTime = 0;
        if (position.x < 4) {
            xTime = Math.abs(4 - position.x);
        }
        else if (position.x > 5) {
            xTime = position.x - 5;
        }
        timeJd.to(sp, {
            x: (Laya.stage.width - 319 * scX) / 2 + 203 * scX / 2 + 116 * scX + sp.width,
            y: 165 * scX + sp.height * 1.2,
            rotation: 2000,
        }, 200 + position.y * 50 + xTime * 30, Laya.Ease.linearInOut, 0);
        timeJd.to(sp, {
            x: (Laya.stage.width - 319 * scX) / 2 + 203 * scX / 2 + 50 * scX / 1.2,
            y: 200 * scX + sp.height * 1.2,
        }, 100, Laya.Ease.linearInOut, 0);
        timeJd.on(Laya.Event.COMPLETE, this, function (e) {
            _this.playSp((Laya.stage.width - 319 * scX) / 2 + 203 * scX / 2 + 50 * scX / 1.2, 200 * scX + sp.height * 1.2);
            _this.exRoleImg();
            config_1.default.userNowHp -= basics;
            //判断血量是否达到了某个值
            //50%
            if (config_1.default.userNowHp <= config_1.default.userHp / 2 && config_1.default.userNowHp > config_1.default.userHp / 10) { //50%
                _this.main.setRoleImg(config_1.default.nowLevel % 8, false);
            }
            else if (config_1.default.userNowHp <= config_1.default.userHp / 10) { //最后10%
                _this.main.setRoleImg(config_1.default.nowLevel % 8, true);
            }
            if (config_1.default.nowLevel > config_1.default.passLevel && !config_1.default.passOk) {
                config_1.default.passOk = true;
                if (config_1.default.newStep) {
                    _this.conPass();
                }
                config_1.default.passLevel++;
            }
            if (config_1.default.userNowHp <= 0) {
                config_1.default.userNowHp = 0; //请求接口进入下一关
                config_1.default.nowLevel++;
                _this.setRoleImg();
                _this.main.leftTopImg(parseInt(config_1.default.nowLevel) + 1);
                if (!config_1.default.passOk) {
                    if (config_1.default.newStep) {
                        _this.conPass();
                    }
                    config_1.default.passLevel++;
                }
                config_1.default.passOk = true;
                _this.main.setLevel(config_1.default.nowLevel);
                if (config_1.default.nowLevel > 4) {
                    config_1.default.userHp = config_1.default.bossHpArr[config_1.default.bossHpArr.length - 1] + 100 * (config_1.default.nowLevel - 1);
                    config_1.default.userNowHp = config_1.default.bossHpArr[config_1.default.bossHpArr.length - 1] + 100 * (config_1.default.nowLevel - 1);
                }
                else {
                    config_1.default.userHp = config_1.default.bossHpArr[config_1.default.nowLevel];
                    config_1.default.userNowHp = config_1.default.bossHpArr[config_1.default.nowLevel];
                }
            }
            _this.main.setProsPos();
            sp.removeSelf();
            if (config_1.default.musicOpen)
                new SoundManager_1.default('audio/sj.mp3', false, 1);
        });
        timeJd.play(0, false);
        Laya.stage.addChild(sp);
    };
