    //获得金币，新物品解锁，离线收益，钻石公共弹出
    /********
     * parms:
     *  str:数量或者名称
     * type:是数字还是文字
     *  fontName:位图名称
     *  topUrl：顶部图片路径
     *  foodName:物品路径
     * btnName:按钮路径
     * callName:回调标识
     * callBack:回调
     * ******/
    PopupManager.prototype.getGiftComm = function (str, type, fontName, topUrl, foodName, btnName, callName, callBack) {
        var _this = this;
        if (callBack === void 0) { callBack = null; }
        var giftOpac = this.opacityBg();
        //添加背景
        var scX = Laya.Browser.window.scX;
        var freeGold = this.getImage('newFood/center.png', 438 * scX, 415 * scX, (giftOpac.width - 438 * scX) / 2, (giftOpac.height - 600 * scX) / 2);
        var light = this.getImage('alive/aliveLight.png', 750 * scX, 758 * scX, giftOpac.width / 2, freeGold.y + freeGold.height / 2 * 1.2);
        light.pivot(light.width / 2, light.height / 2);
        var _r = Laya.Tween.to(light, {
            rotation: 360,
            update: Laya.Handler.create(this, function (e) {
            })
        }, 5000, Laya.Ease.linearInOut, Laya.Handler.create(this, function (e) {
        }), 0);
        _r.repeat = 100000;
        //顶部文字
        var topTxt = this.getImage("" + topUrl);
        topTxt.width = topTxt.getBounds().width * scX;
        topTxt.height = topTxt.getBounds().height * scX;
        topTxt.pos((freeGold.width - topTxt.width / 1.3) / 2, -topTxt.height / 1.1);
        freeGold.addChild(topTxt);
        //中部内容
        var food = this.getImage("" + foodName);
        food.width = food.getBounds().width * scX;
        food.height = food.getBounds().height * scX;
        food.pos((freeGold.width - food.width) / 2, (freeGold.height - food.height) / 2);
        //添加右上角按钮
        var close = this.getImage('freeGold/cls.png', 58 * scX, 59 * scX, freeGold.width, -59 * scX);
        //添加文字
        var goldTxt = new Laya.Text();
        if (type == 0)
            goldTxt.text = "" + str;
        else if (type == -1)
            goldTxt.visible = false;
        else
            goldTxt.text = "" + new FormatNumber_1.default(str).formatPointNumber();
        goldTxt.font = "" + fontName;
        goldTxt.fontSize = 40 * scX;
        goldTxt.pos((freeGold.width - goldTxt.width) / 2, freeGold.height);
        var getGold = this.getImage("" + btnName);
        getGold.width = getGold.getBounds().width * scX;
        getGold.height = getGold.getBounds().height * scX;
        getGold.pos((freeGold.width - getGold.width) / 2, goldTxt.y + goldTxt.height * 2);
        freeGold.addChild(close);
        freeGold.addChild(goldTxt);
        freeGold.addChild(food);
        freeGold.addChild(getGold);
        giftOpac.addChild(light);
        getGold.pivot(getGold.width / 2, getGold.height / 2);
        getGold.pos(freeGold.width / 2, goldTxt.y + goldTxt.height * 2 + getGold.height / 2);
        var clickOk = true;
        var self = this;
        getGold.on(Laya.Event.CLICK, this, function () {
            if (config_1.default.musicOpen)
                new SoundManager_1.default('audio/btn.mp3', false, 1);
            if (!clickOk)
                return;
            clickOk = false;
            new BtnAnimation_1.default(getGold, function () {
                if (callName == 'outLine') {
                    new AdManager_1.default(false).createAd(function (data) {
                        new GetData_1.default("/KillSlagBoy/user/lockAd.action", 'get', {}, config_1.default.cookie, function (data) {
                            config_1.default.lookNum++;
                        });
                        if (data == 1) {
                            if (callBack != null)
                                callBack(callName);
                            self.hidePopup();
                        }
                    });
                }
                else {
                    if (callBack != null)
                        callBack(callName);
                    self.hidePopup();
                }
                clickOk = true;
            }, false).jelly();
        });
        close.on(Laya.Event.CLICK, this, function () {
            if (config_1.default.musicOpen)
                new SoundManager_1.default('audio/btn.mp3', false, 1);
            // if (!closeOk) return;
            // if (callBack != null) callBack(callName);
            _this.hidePopup();
        });
        giftOpac.addChild(freeGold);
        // this.addChild(giftOpac);
    };
    //新手引导第一步
    PopupManager.prototype.newStep1 = function (callback) {
        if (callback === void 0) { callback = null; }
        var scX = Laya.Browser.window.scX;
        var scY = Laya.Browser.window.scY;
        var newStepManager = new Laya.Sprite();
        newStepManager.width = 750 * scX;
        newStepManager.height = 1334 * scY;
        newStepManager.pos(0, 0);
        var newStep = this.getImage("newStep/step1.png", 750 * scX, 1334 * scX, (newStepManager.width - 750 * scX) / 2, (newStepManager.height - 1334 * scX) / 2);
        newStepManager.zOrder = 999;
        newStepManager.on(Laya.Event.CLICK, this, function (e) {
            return;
        });
        //剩余的多少
        // let _w:number=Laya.stage.width-newStep.width; //代表宽度有剩余
        var _h = Laya.stage.height - newStep.height; //代表剩余的高度
        if (_h > 0) {
            var top_1 = new Laya.Sprite();
            top_1.graphics.drawRect(0, 0, Laya.stage.width, _h / 2, '#404040');
            top_1.alpha = .7;
            var bottom = new Laya.Sprite();
            bottom.graphics.drawRect(0, newStep.height + _h / 2, Laya.stage.width, _h / 2, '#404040');
            bottom.alpha = .7;
            newStepManager.addChild(top_1);
            newStepManager.addChild(bottom);
        }
        newStepManager.addChild(newStep);
        //添加title
        var titleBg = this.getImage("newStep/kkTip.png", 456 * scX, 156 * scX, (newStep.width - 456 * scX) / 2, 300 * scX);
        //添加文字
        var tipNum = new Laya.Text();
        tipNum.text = "\u70B9\u51FB\u6309\u94AE\u5F00\u59CB\u6D88\u9664\u6E23\u7537\u5427\uFF01";
        tipNum.fontSize = 50 * scX;
        tipNum.align = 'center';
        tipNum.wordWrap = true;
        tipNum.width = 420 * scX;
        // tipNum.height=130*scX;
        tipNum.color = '#000';
        tipNum.pos((titleBg.width - tipNum.width) / 2, (titleBg.height - tipNum.height) / 2);
        titleBg.addChild(tipNum);
        newStep.addChild(titleBg);
        newStep.on(Laya.Event.CLICK, this, function (e) {
            if (e.stageX > 170 * scX && e.stageX < 570 * scX && e.stageY > 435 * scY && e.stageY < 645 * scY) {
                Laya.stage.removeChild(newStepManager);
                if (callback != null)
                    callback();
            }
        });
        //添加手 
        var hand = this.getImage("newStep/hand.png", 105 * scX, 108 * scX, (newStep.width - 105 * scX) / 2, 580 * scX);
        hand.pivot(hand.width / 2, hand.height / 2);
        hand.pos((newStep.width - 105 * scX) / 2 + hand.width / 2, 580 * scX);
        //添加动画
        var toDown = new Laya.TimeLine();
        var handY = hand.y;
        toDown.to(hand, {
            y: handY + 20 * scX,
            scaleX: 1.1,
            scaleY: 1.1
        }, 600, Laya.Ease.linearInOut, 0);
        toDown.to(hand, {
            y: handY,
            scaleX: 1,
            scaleY: 1
        }, 600, Laya.Ease.linearInOut, 0);
        toDown.play(0, true);
        newStep.addChild(hand);
        //开始按钮的位置
        Laya.stage.addChild(newStepManager);
    };
